  PRIMARY KEY (`desc_id`)
) ENGINE=InnoDB AUTO_INCREMENT=3144 DEFAULT CHARSET=latin1;

/*Data for the table `descrotion_list` */

insert  into `descrotion_list`(`desc_id`,`item_id`,`description`,`image`,`create_at`,`status`) values (1575,903,'Xiaomi Mi4 64GB Details\nThe Xiaomi Mi4 (64GB) is a top-end smartphone from the company that brings the latest and greatest features coupled with a very attractive price. The Mi4 gives costlier flagship smartphones a run for their money with top-of-the-line specs for insane performance and a great user experience.\n','','2017-10-31 16:29:44',1),(1576,903,'Processor and Memory\nThe Mi4 is powered by the Snapdragon 801 processor, which is a quad-core chip with each core clocked at 2.5GHz for screaming fast performance in all scenarios. For multitasking, the Mi4 provides 4GB of RAM so you can keep all your important apps running at the same time and switch between them at an instant. The Adreno 330 GPU takes care of graphics and allows best-looking games to run without a hitch or stutter. For storage, there is 64GB integrated inside the device. It can\'t be expanded via a microSD slot, however.\n','','2017-10-31 16:29:44',1),(1577,903,'Display and Battery\nThe Mi4 comes with a 5-inch Full HD display at the front. The display is an LCD unit that provides great viewing angles and accurate colors for a top-notch visual experience. The screen is insanely sharp as well due to the 5-inch size and the high resolution. Powering the display is a 3,000 mAh battery that is rated for long periods of continued use. Thanks to fast charging support, the battery can be charged to 60 percent in only 30 minutes, so you can go about your day without waiting for the device to finish charging to a usable level.\n','','2017-10-31 16:29:44',1),(1578,903,'Camera and Connectivity\nThe Mi4 comes with a 13-megapixel rear camera. The camera has an aperture size of F1.8 for high image quality in low-light situations. On the front, there is an 8-megapixel camera for selfies and video calls. All your photos and videos can be shared using any of the connectivity features loaded on the device, including Wi-Fi, Bluetooth, and 3G. GPS helps you navigate through the country\'s busy roads, and a microUSB port can be used for transferring data to and from a computer.\n','','2017-10-31 16:29:44',1),(1603,864,'Vivo Y69 Details\r\nIntroduction and Display\r\nThe Vivo Y69 is a mid-range Android-based smartphone. The device is aimed at all selfie-enthusiasts. The Vivo Y69 weighs 162.8 grams, and the dimensions of the device are 154.6 x 75.7 x 7.7mm. The smartphone boasts a 5.5-inch HD IPS display which is bright and does the job pretty well. The screen features a coating of Corning\'s Gorilla Glass 3 protection which prevents the device from attracting any unwanted scratches. \r\nThe Vivo Y69 sports rounded edges which make the smartphone easy to hold and carry around.\r\n','','2017-10-31 16:35:01',1),(1604,864,'Performance and Camera\r\nUnder the hood, the Y69 is equipped with a 1.5GHz octa-core MediaTek chipset and 3GB of RAM to provide users with a flawless and lag-free smartphone experience. You can afford to work on various apps at the same time and even indulge in games like Modern Combat without worrying about any performance issues.\r\nIn the imaging department, the Vivo Y69 comes with a 13-megapixel rear camera and a 16-megapixel front-facing shooter. The primary camera comes with an LED flash to take care of low-light conditions while the front camera can be used for video calling and selfies.\r\n','','2017-10-31 16:35:01',1),(1605,864,'Storage and Battery\r\nThe Vivo Y69 packs a non-removable Li-Ion 3,000mAh battery which is expected to support talk time of 6 hours. \r\nFor storing media files, data and apps, the smartphone comes with an internal storage space 32GB which can be expanded using a microSD card up to 256GB.\r\n','','2017-10-31 16:35:01',1),(1606,864,'Connectivity and Platform\r\nConnectivity options on the Vivo Y69 include 4G, Bluetooth 4.2, GPS, Wi-Fi 802.11 b/g/n, dual SIM support and a microUSB 2.0 port. On the software front, the smartphone runs Android 7.0 Nougat wrapped under the proprietary Funtouch OS 3.2 on top.\r\n','','2017-10-31 16:35:01',1),(1607,865,'Vivo Y69 Details\r\nIntroduction and Display\r\nThe Vivo Y69 is a mid-range Android-based smartphone. The device is aimed at all selfie-enthusiasts. The Vivo Y69 weighs 162.8 grams, and the dimensions of the device are 154.6 x 75.7 x 7.7mm. The smartphone boasts a 5.5-inch HD IPS display which is bright and does the job pretty well. The screen features a coating of Corning\'s Gorilla Glass 3 protection which prevents the device from attracting any unwanted scratches. \r\nThe Vivo Y69 sports rounded edges which make the smartphone easy to hold and carry around.\r\n','','2017-10-31 16:35:41',1),(1608,865,'Performance and Camera\r\nUnder the hood, the Y69 is equipped with a 1.5GHz octa-core MediaTek chipset and 3GB of RAM to provide users with a flawless and lag-free smartphone experience. You can afford to work on various apps at the same time and even indulge in games like Modern Combat without worrying about any performance issues.\r\nIn the imaging department, the Vivo Y69 comes with a 13-megapixel rear camera and a 16-megapixel front-facing shooter. The primary camera comes with an LED flash to take care of low-light conditions while the front camera can be used for video calling and selfies.\r\n','','2017-10-31 16:35:41',1),(1609,865,'Storage and Battery\r\nThe Vivo Y69 packs a non-removable Li-Ion 3,000mAh battery which is expected to support talk time of 6 hours. \r\nFor storing media files, data and apps, the smartphone comes with an internal storage space 32GB which can be expanded using a microSD card up to 256GB.\r\n','','2017-10-31 16:35:41',1),(1610,865,'Connectivity and Platform\r\nConnectivity options on the Vivo Y69 include 4G, Bluetooth 4.2, GPS, Wi-Fi 802.11 b/g/n, dual SIM support and a microUSB 2.0 port. On the software front, the smartphone runs Android 7.0 Nougat wrapped under the proprietary Funtouch OS 3.2 on top.\r\n','','2017-10-31 16:35:41',1),(1611,862,'Vivo Y66 Details\r\nIntroduction and Design\r\nThe Vivo Y66 is a mid-range smartphone that makes its mark with decent specifications. The smartphone is available in gold and rose gold options and runs the Android 6.0 Marshmallow operating system with the proprietary Funtouch OS 3.0 on top. Also, to make it easy for users to carry the device around, the Y66 sports rounded edges on all sides. \r\n','','2017-10-31 16:36:24',1),(1612,862,'Display and Connectivity\r\nThe Vivo Y66 boasts a 5.5-inch HD display which is protected from minor scratches as the screen features a coating of Corning\'s Gorilla Glass 3. The Vivo Y66 is bundled with all the standard connectivity options that include 4G, Bluetooth 4.0, GPS, Wi-Fi 802.11 b/g/n, and a miroUSB 2.0 port. \r\n','','2017-10-31 16:36:24',1),(1613,862,'Camera and Storage\r\nThe device comes with a 13-megapxiel primary camera which also has an LED flash that helps you in shooting images and videos in the dark. On the front, the Y66 has a 5-megapxiel front-facing camera for selfies and video calls. \r\nYou can click your heart out and not worry about storing them as the device comes with 32GB of onboard storage space which can further be expanded up to 128GB using a microSD card. \r\n','','2017-10-31 16:36:24',1),(1614,862,'Performance and Battery\r\nThe Vivo Y66 is fuelled by a non-removable Li-Ion 3,000mAh battery which supports talk time up to 14 hours and is tipped to last for an entire day for a normal user. \r\nUnder the hood, the device hosts a 1.4GHz octa-core Snapdragon 430 chipset which is paired with 3GB of RAM to ensure that users get a smooth and lag-free smartphone experience even while operating multiple apps simultaneously. \r\n','','2017-10-31 16:36:24',1),(1615,863,'Vivo Y66 Details\r\nIntroduction and Design\r\nThe Vivo Y66 is a mid-range smartphone that makes its mark with decent specifications. The smartphone is available in gold and rose gold options and runs the Android 6.0 Marshmallow operating system with the proprietary Funtouch OS 3.0 on top. Also, to make it easy for users to carry the device around, the Y66 sports rounded edges on all sides. \r\n','','2017-10-31 16:37:09',1),(1616,863,'Display and Connectivity\r\nThe Vivo Y66 boasts a 5.5-inch HD display which is protected from minor scratches as the screen features a coating of Corning\'s Gorilla Glass 3. The Vivo Y66 is bundled with all the standard connectivity options that include 4G, Bluetooth 4.0, GPS, Wi-Fi 802.11 b/g/n, and a miroUSB 2.0 port. \r\n','','2017-10-31 16:37:09',1),(1617,863,'Camera and Storage\r\nThe device comes with a 13-megapxiel primary camera which also has an LED flash that helps you in shooting images and videos in the dark. On the front, the Y66 has a 5-megapxiel front-facing camera for selfies and video calls. \r\nYou can click your heart out and not worry about storing them as the device comes with 32GB of onboard storage space which can further be expanded up to 128GB using a microSD card. \r\n','','2017-10-31 16:37:09',1),(1618,863,'Performance and Battery\r\nThe Vivo Y66 is fuelled by a non-removable Li-Ion 3,000mAh battery which supports talk time up to 14 hours and is tipped to last for an entire day for a normal user. \r\nUnder the hood, the device hosts a 1.4GHz octa-core Snapdragon 430 chipset which is paired with 3GB of RAM to ensure that users get a smooth and lag-free smartphone experience even while operating multiple apps simultaneously. \r\n','','2017-10-31 16:37:09',1),(1619,861,'Vivo Y55s Details\r\nIntroduction\r\nThe Vivo Y55s is an entry-level smartphone device with a sleek metal body design. The device looks similar to the Vivo V5 and V5 Plus, but it is a totally different device in terms of hardware specifications and features. The Vivo Y55s is available in Crown Gold, and Space Grey.\r\n','','2017-10-31 16:37:56',1),(1620,861,'Display & Camera\r\nThe Vivo Y55s flaunts a 5.2-inch IPS LCD display with HD resolution that gives it a pixel density of 282 PPI. The display supports multitouch up to 5 fingers and comes with a scratch-resistant coating.  The primary camera on the Vivo Y55s is a 13-megapixel unit with autofocus and LED flash, whereas, a secondary camera is a 5-megapixel unit. Both the cameras can record Full HD videos at 30 frames per second. The camera software comes with beautification and panorama modes.\r\n','','2017-10-31 16:37:56',1),(1621,861,'Software & Hardware\r\nThe Vivo Y55s comes loaded with Android 6.0 Marshmallow operating system; it is customised with Funtouch 3.0 UI. However, the customised launcher does not has an application drawer. Nonetheless, it has many other useful customisation features. The Vivi Y55s houses the Qualcomm’s latest Snapdragon 425 chipset. The quad-core chipset that the device comes with is a low-end chipset. Nonetheless, it has a newer architecture which allows for lower power consumption. In addition to the Snapdragon 425 chipset, the device has 3GB of RAM and 16GB of storage.\r\n','','2017-10-31 16:37:56',1),(1622,861,'Battery & Connectivity\r\nA 2,730 mAh non-removable Li-Ion battery is in charge of powering the Vivo Y55s. In spite of the chipset supporting the fast charging technology, the Vivo Y55s doesn’t.  The connectivity features on the Vivo Y55s include dual-SIM 4G LTE with VoLTE, Bluetooth v4.0, GPS with A-GPS, FM Radio, Wi-Fi b/g/n, Wi-Fi Direct, a 3.5mm audio jack, and a microUSB v2.0 port.\r\n','','2017-10-31 16:37:56',1),(1623,859,'Vivo Y53 Details\r\nINTRODUCTION AND BATTERY\r\nThe Vivo Y53 is the successor to the Y51. The mid-range device runs the Android 6.0 Marshmallow operating system out of the box and sports curved edges which make it easy to hold and carry around. \r\nThe handset packs a Li-Ion 2,500mAh battery which is enough to provide an entire day of uninterrupted smartphone usage for a normal user.\r\n','','2017-10-31 16:38:37',1),(1624,859,'CAMERA AND PERFORMANCE\r\nAt its heart, the device is powered by a 1.4GHz quad-core Snapdragon 425 chipset to handle tasks flawlessly, and also there is 2GB of RAM which aid multitasking. \r\nFor shutterbugs, the device comes with an 8-megapixel rear camera which also has an LED flash to support low-light photography. On the front, the device is equipped with a 5-megapixel front-facing shooter.\r\n','','2017-10-31 16:38:37',1),(1625,859,'CONNECTIVITY AND DISPLAY\r\nThe Vivo Y53 features a 5-inch qHD display which is bright and reproduces warm colours. The display suffers once you stroll out in the sun. \r\nFor connectivity, the smartphone comes with options like 4G, Bluetooth 4.2, GPS, Wi-Fi 802.11 b/g/n, and a microUSB 2.0 port.\r\n','','2017-10-31 16:38:37',1),(1626,859,'STORAGE\r\nThe Vivo Y53 ships with an internals storage capacity of 16GB which can further be expanded up to 256GB via the microSD card slot.\r\n','','2017-10-31 16:38:37',1),(1631,868,'Vivo V7 Plus Details\r\nIntroduction and Performance\r\nThe Vivo V7 Plus is a mid-range Android-based smartphone that is targetted towards the selfie-crazy population. The device looks similar to the X7 Plus; sports a metal unibody design and has curved edges on all sides. Also, there is a fingerprint reader which is embedded in the front-facing home button that lets users unlock the device with a finger. \r\nTo deliver smooth and flawless performance, the Vivo V7 Plus is powered by an octa-core Snapdragon 450 chipset which is clocked at 2.2GHz. Also, there is 4GB of RAM to handle multitasking and high-end games. \r\n','0.29471800 15094482763.jpeg','2017-10-31 16:41:16',1),(1632,868,'Camera and Display\r\nThe Vivo V7 Plus comes with dual front shooters which can be used for blurring and wide-angle selfies. The 24-megapixel front camera can also be used for video calling via apps like Skype, Messenger, etc. At the back, the smartphone hosts a 16-megapixel primary shooter which along with an LED flash can be used to capture images and videos in both dark and bright conditions. \r\nIn terms of display, the Vivo V7 Plus flaunts a 5.9-inch Full HD display which is bright and reproduces vivid colours. The screen is also paired with good viewing angles that let users enjoy videos and games on the big screen. \r\n','0.29485900 15094482764des.jpeg','2017-10-31 16:41:16',1),(1633,868,'Storage and Battery\r\nThe smartphone is equipped with an internal storage space of 64GB which can be expanded up to 256GB via a microSD card. However, 64GB is enough for a moderate user. \r\nThe handset packs a non-removable 3,225mAh battery which doesn\'t sound enough but is good to last long for a normal user.\r\n','0.29493200 15094482763des.jpeg','2017-10-31 16:41:16',1),(1634,868,'Platform and Connectivity\r\nThe Vivo V7 Plus runs the Android 7.1 Nougat operating system out of the box and ships with multiple connectivity options which include 4G, Wi-Fi 802.11 a/b/g/n/ac, GPS, Bluetooth 4.2, and a microUSB 2.0 port. \r\n','','2017-10-31 16:41:16',1),(1635,866,'Vivo V5s Details\r\nIntroduction and Design\r\nThe latest selfie focused Android-based smartphone is the Vivo V5s. The device which succeeds the V5comes with similar specifications. The smartphone is available in black colour and comes with a front-mounted fingerprint reader which is integrated into the home button. \r\n','','2017-10-31 16:42:23',1),(1636,866,'Camera and Display\r\nOne of the major highlights of the device is that it comes with a stunning 20-megapixel front-facing camera which can capture impressive selfies. Also, there is a 13-megapixel rear camera which can also be used for imaging and recording videos even in bad lighting conditions, thanks to the LED flash.  \r\nThe Vivo V5s boasts a 5.5-inch Full HD display which is contemplated with good viewing angles that reproduce crisp and vivid colours. \r\n','','2017-10-31 16:42:23',1),(1637,866,'Performance and Battery\r\nUnder the hood, the V5s is powered by a 1.5GHz octa-core MediaTek chipset and 4GB of RAM which ensures a smooth and lag-free performance even while multitasking. \r\nThe smartphone is backed by a non-removable Li-Ion 3,000mAh cell which is enough to last for an entire day for a moderate user. \r\n','','2017-10-31 16:42:23',1),(1638,866,'Platform and Connectivity\r\nThe Vivo V5s runs the Android 6.0 Marshmallow wrapped under the company\'s own FunTouch 2.6 operating system out of the box. For connectivity, the device is bundled with options like 4G, Bluetooth 4.1, GPS, Wi-Fi 802.11 b/g/n, and a microUSB 2.0 port\r\n','','2017-10-31 16:42:23',1),(1639,867,'Vivo V5s Details\r\nIntroduction and Design\r\nThe latest selfie focused Android-based smartphone is the Vivo V5s. The device which succeeds the V5comes with similar specifications. The smartphone is available in black colour and comes with a front-mounted fingerprint reader which is integrated into the home button. \r\n','0.67619400 15094484383d.jpeg','2017-10-31 16:43:58',1),(1640,867,'Camera and Display\r\nOne of the major highlights of the device is that it comes with a stunning 20-megapixel front-facing camera which can capture impressive selfies. Also, there is a 13-megapixel rear camera which can also be used for imaging and recording videos even in bad lighting conditions, thanks to the LED flash.  \r\nThe Vivo V5s boasts a 5.5-inch Full HD display which is contemplated with good viewing angles that reproduce crisp and vivid colours. \r\n','0.67630200 15094484381d.jpeg','2017-10-31 16:43:58',1),(1641,867,'Performance and Battery\r\nUnder the hood, the V5s is powered by a 1.5GHz octa-core MediaTek chipset and 4GB of RAM which ensures a smooth and lag-free performance even while multitasking. \r\nThe smartphone is backed by a non-removable Li-Ion 3,000mAh cell which is enough to last for an entire day for a moderate user. \r\n','0.67637700 15094484383d.jpeg','2017-10-31 16:43:58',1),(1642,867,'Platform and Connectivity\r\nThe Vivo V5s runs the Android 6.0 Marshmallow wrapped under the company\'s own FunTouch 2.6 operating system out of the box. For connectivity, the device is bundled with options like 4G, Bluetooth 4.1, GPS, Wi-Fi 802.11 b/g/n, and a microUSB 2.0 port\r\n','0.67645300 15094484384d.jpeg','2017-10-31 16:43:58',1),(1643,871,'Samsung Galaxy J7 Pro Details\r\nThe Samsung Galaxy J7 Pro is the latest from Samsung with a combination of quality specs such as a loaded chipset, good cameras, a large screen and a front-mounted fingerprint scanner.\r\n','','2017-10-31 16:54:32',1),(1644,871,'Display and Design\r\nThe J7 Pro is fronted by a Full HD resolution 5.5-inch IPS LCD that shows excellent visuals for entertainment. An IPS LCD also provides good readability when out in the sun and at skewed viewing angles. The phone features the standard arrangement of home and navigation buttons below the screen. The home button also houses a fingerprint sensor. The phone is available in black and gold exteriors.\r\n','','2017-10-31 16:54:32',1),(1645,871,'Platform and Memory\r\nThe J7 Pro is powered by an Exynos chipset that runs Nougat 7.0 OS. The chipset bears 3GB of RAM and an eight-core Cortex-A53 CPU clocked at a maximum speed of 1.6GHz. These numbers enable the phone to run apps and multitask at a good speed. Storage on the J7 Pro is limited to 64GB that can be pushed to 256GB with a microSD card. The chipset also bears a Mali-T880MP2 GPU.\r\n','','2017-10-31 16:54:32',1),(1646,872,'Samsung Galaxy J7 Pro Details\r\nThe Samsung Galaxy J7 Pro is the latest from Samsung with a combination of quality specs such as a loaded chipset, good cameras, a large screen and a front-mounted fingerprint scanner.\r\n','','2017-10-31 16:55:04',1),(1647,872,'Display and Design\r\nThe J7 Pro is fronted by a Full HD resolution 5.5-inch IPS LCD that shows excellent visuals for entertainment. An IPS LCD also provides good readability when out in the sun and at skewed viewing angles. The phone features the standard arrangement of home and navigation buttons below the screen. The home button also houses a fingerprint sensor. The phone is available in black and gold exteriors.\r\n','','2017-10-31 16:55:04',1),(1648,872,'Platform and Memory\r\nThe J7 Pro is powered by an Exynos chipset that runs Nougat 7.0 OS. The chipset bears 3GB of RAM and an eight-core Cortex-A53 CPU clocked at a maximum speed of 1.6GHz. These numbers enable the phone to run apps and multitask at a good speed. Storage on the J7 Pro is limited to 64GB that can be pushed to 256GB with a microSD card. The chipset also bears a Mali-T880MP2 GPU.\r\n','','2017-10-31 16:55:04',1),(1649,877,'Samsung Galaxy J7 Prime Details\r\nIntroduction & Design\r\nThe Samsung Galaxy J7 Prime is the latest variant of the original Galaxy J7 launched in 2016. The latest variant has a better display, camera and an increased amount of internal storage. The most significant change though is the new design, the Galaxy J7 prime looks and feels premium than the Galaxy J7 2016. The metal look at the back and the moulded edge on the front of the device make it much more appealing to eyes.  \r\n','','2017-10-31 16:55:29',1),(1650,877,'Display & Camera\r\nThe display on the Galaxy J7 Prime now comes with Full HD resolution although there is no AMOLED technology, it still uses PLS TFT LCD which is much cheaper, making the device affordable. The 2.5D Gorilla Glass 4 on the device makes it look premium and distinguishable from Galaxy J7 2016. Similar to the new Galaxy A9 Pro’s selfie camera, the Galaxy J7 Prime also now comes with the 8-megapixel secondary camera for sharp selfies. The primary camera though is the tried and tested 13-megapixel unit that has an aperture of f/1.9.\r\n','','2017-10-31 16:55:29',1),(1651,877,'Software & Performance\r\nOn the software side, the device is loaded with Android 6.0 Marshmallow operating system. The OS is tweaked with Samsung’s TouchWiz UI. The new UI looks clean and feels fast during the operation. The octa-core processor and 3GB of RAM handles the performance and multitasking. Let it be scrolling or playing heavy games, the Galaxy J7 Prime never jitters or lags. The onboard storage of 32GB ensures that you don\'t run out of storage fast. Also, the expandable storage comes handy in case you run out of storage.\r\n','','2017-10-31 16:55:29',1),(1652,877,'Battery & Connectivity\r\nA massive 3,300 mAh battery keeps the battery backup in check and ensures that the device runs throughout the day even when you use it heavily which includes playing games and watching high-definition videos. The device can accommodate two Micro-SIM cards and supports 4G LTE on both of them. Apart from the primary connectivity, the Galaxy J7 Prime has Wi-Fi a/b/g/n/ac, Bluetooth 4.1, GPS, A-GPS, GLONASS and the microUSB port takes care of sync and charge.\r\n','','2017-10-31 16:55:29',1),(1653,875,'Samsung Galaxy J7 Prime Details\r\nIntroduction & Design\r\nThe Samsung Galaxy J7 Prime is the latest variant of the original Galaxy J7 launched in 2016. The latest variant has a better display, camera and an increased amount of internal storage. The most significant change though is the new design, the Galaxy J7 prime looks and feels premium than the Galaxy J7 2016. The metal look at the back and the moulded edge on the front of the device make it much more appealing to eyes.  \r\n','','2017-10-31 16:56:47',1),(1654,875,'Display & Camera\r\nThe display on the Galaxy J7 Prime now comes with Full HD resolution although there is no AMOLED technology, it still uses PLS TFT LCD which is much cheaper, making the device affordable. The 2.5D Gorilla Glass 4 on the device makes it look premium and distinguishable from Galaxy J7 2016. Similar to the new Galaxy A9 Pro’s selfie camera, the Galaxy J7 Prime also now comes with the 8-megapixel secondary camera for sharp selfies. The primary camera though is the tried and tested 13-megapixel unit that has an aperture of f/1.9.\r\n','','2017-10-31 16:56:47',1),(1655,875,'Software & Performance\r\nOn the software side, the device is loaded with Android 6.0 Mars