ped under Android 7.1.\r\n','','2017-10-31 17:26:14',1),(1736,856,'Performance and Storage\r\nUnder the hood, the handset is equipped with a 1.5GHz octa-core MediaTek chipset which is coupled with 3GB of RAM to take care of your multitasking requirements. The Oppo A71 offers a smooth and lag-free smartphone experience. \r\nFor storing files and data, the device ships with an onboard storage space of 16GB. If that does not fulfil your requirements, the device comes with an option to expand further using a microSD card up to 128GB.\r\n','','2017-10-31 17:26:14',1),(1737,856,'Camera and Display\r\nThe Oppo A71 comes with a 5-megapixel front-facing shooter that can be used for capturing selfies and video calling. Also, at the back, the device hosts a 13-megapixel rear shooter which has now become a norm in most standard smartphones. The rear camera is also bundled with features like phase detection autofocus, HDR, panorama, etc. The primary camera is also aided with an LED flash to handle low-light photos and videos. \r\nThe Oppo A71 features a 5.2-inch HD IPS display which is bright and ideal for watching videos or playing games.\r\n','','2017-10-31 17:26:14',1),(1738,856,'Connectivity and Battery\r\nConnectivity options on the Oppo A71 include 4G, Bluetooth 4.0, GPS, Wi-Fi 802.11 b/g/n, and a microUSB 2.0 port. Besides all the regular connectivity options, the device has support for dual SIM that lets users use two different networks on the smartphone. \r\nFor power, the device hosts a non-removable Li-Ion 3,000mAh battery.\r\n\r\n','','2017-10-31 17:26:14',1),(1739,855,'Oppo A57 Details\r\nDisplay and Design\r\nA 5.2-inch display with 2.5D curved glass fronts the Oppo A57. The display has HD resolution that shows quality media for entertainment. The device is available in two colors: rose gold and gold. Dimensions of the phone are 149.1 x 72.9 x 7.65 mm while weighing 147 grams.\r\n','','2017-10-31 17:26:45',1),(1740,855,'Platform and Memory\r\nThe A57 runs Marshmallow 6.0 with Oppo’s Color 3.0 OS on top, on a Snapdragon 435 system-on-chip with a 1.4 GHz octa-core processor and 3GB of RAM that efficiently multitasks. The A57 is equipped with 32GB of storage space that can be increased to 128GB with an SD card.\r\n','','2017-10-31 17:26:45',1),(1741,855,'Cameras and Battery\r\nThe secondary camera on the A57 is 16-megapixels that has a f/2.0 aperture that captures quality images. The primary camera is 13-megapixels that also takes quality pictures aided by LED flash and PDAF. The battery that powers the A57 is 2,900mAh that is non-removable. The battery lasts twenty hours at best.\r\n','','2017-10-31 17:26:45',1),(1742,855,'Connectivity and other features\r\nThe A57 supports dual nano-SIM cards that support 4G and 3G mobile data. The A57 also offers Wi-Fi 802.11 b/g/n support, Bluetooth 4.1, and a microUSB 2.0 port. The home buttons doubles as a fingerprint scanner.\r\n','','2017-10-31 17:26:45',1),(1743,854,'Oppo A57 Details\r\nDisplay and Design\r\nA 5.2-inch display with 2.5D curved glass fronts the Oppo A57. The display has HD resolution that shows quality media for entertainment. The device is available in two colors: rose gold and gold. Dimensions of the phone are 149.1 x 72.9 x 7.65 mm while weighing 147 grams.\r\n','','2017-10-31 17:27:12',1),(1744,854,'Platform and Memory\r\nThe A57 runs Marshmallow 6.0 with Oppo’s Color 3.0 OS on top, on a Snapdragon 435 system-on-chip with a 1.4 GHz octa-core processor and 3GB of RAM that efficiently multitasks. The A57 is equipped with 32GB of storage space that can be increased to 128GB with an SD card.\r\n','','2017-10-31 17:27:12',1),(1745,854,'Cameras and Battery\r\nThe secondary camera on the A57 is 16-megapixels that has a f/2.0 aperture that captures quality images. The primary camera is 13-megapixels that also takes quality pictures aided by LED flash and PDAF. The battery that powers the A57 is 2,900mAh that is non-removable. The battery lasts twenty hours at best.\r\n','','