d-range Android-based smartphone which available in black and gold colours. The smartphone has support for Samsung Pay and features the Smart Glow 2.0 LED notification ring around the rear camera lens. \r\nThe Galaxy J7 Max flaunts a big 5.7-inch Full HD TFT display which reproduces crisp and vivid colours that make gaming and watching videos more enjoyable. \r\n','','2017-11-13 18:32:34',1),(1760,873,'Performance and Connectivity\r\nUnder the hood, the device is armed with a 1.6GHz octa-core MediaTek chipset which paired with 4GB of RAM is meant to deliver smooth and lag-free performance while multitasking or playing high-end games like Modern Combat. \r\nAs far as connectivity goes, there are options like 4G, dual-SIM support, Bluetooth 4.1, GPS, Wi-Fi 802.11 a/b/g/n, and a microUSB 2.0 port.\r\n','','2017-11-13 18:32:34',1),(1761,873,'Storage and Camera\r\nThe device is clearly meant for image lovers as the Galaxy J7 Max comes with two 13-megapxiel shooters; one at the back and one at the front. The one at the back is also assisted with an LED flash to capture photos and videos even in low-light. \r\nFor storing images, videos, apps, music, etc. there is 32GB of expandable storage space which can be expanded via a microSD card up to 128GB. \r\n','','2017-11-13 18:32:34',1),(1762,873,'Platform and Battery\r\nThe Samsung Galaxy J7 Max is powered by a non-removable Li-Ion 3,000mAh battery and runs the Android 7.0 Nougat operating system out of the box. \r\n','','2017-11-13 18:32:34',1),(1763,874,'Samsung Galaxy J7 Max Details\r\nIntroduction and Display\r\nThe Samsung Galaxy J7 Max is a mid-range Android-based smartphone which available in black and gold colours. The smartphone has support for Samsung Pay and features the Smart Glow 2.0 LED notification ring around the rear camera lens. \r\nThe Galaxy J7 Max flaunts a big 5.7-inch Full HD TFT display which reproduces crisp and vivid colours that make gaming and watching videos more enjoyable. \r\n','','2017-11-13 18