','2017-11-20 12:05:02',1),(1769,901,'The device comes with a 13-megapixel stabilized rear camera with dual-LED flash which can be used to capture vivid images in low light and for first time, 4K UHD and Full HD videos in HDR mode at 30fps. The smartphone also has an 8-megapixel front camera with magic focus that can record Full HD videos at 30fps. ','','2017-11-20 12:05:02',1),(1770,901,'The device comes with 4G LTE bands that promise faster connectivity than 3G. Connectivity options that tag along with the Xiaomi Mi4 are 4G, Wi-Fi- 802.11 a/b/g/n/ac, Bluetooth 4.0, and microUSB 2.0 port. The device comes with Wi-Fi Direct connectivity which enables you to connect devices wirelessly. The device is powered by a non-removable Li-Ion 3080 mAh battery that supports talk time up to 16hours.','','2017-11-20 12:05:02',1),(1775,881,'Samsung Galaxy J2 Ace Details\r\nIntroduction and Display\r\nThe Samsung Galaxy J2 Ace is the latest affordable smartphone under the popular J-series. The device is a step down from the Galaxy J2 Pro that was launched earlier. The smartphone does not differ from its predecessor in terms of looks and is available in black and gold colours. \r\nThe Galaxy J2 Ace is equipped with a 5-inch qHD display that does its job pretty well indoors, but outdoor visibility suffers once you are out in the sun.\r\n','','2017-11-23 15:03:45',1),(1776,881,'Performance and Storage\r\nAt its heart, the smartphone is armed with a 1.4GHz quad-core processor to keep things smooth and also, there is 1.5GB of RAM to ensure lag-free multitasking. \r\nStoring media and apps won\'t be an issue as there is 8GB of internal storage space which can further be expanded using the Hybrid SIM slot with the help of a microSD card up to 256GB.\r\n','','2017-11-23 15:03:45',1),(1777,881,'Platform and Battery\r\nThe device runs the Android 6.0 Marshmallow with the proprietary TouchWiz UI on top. The J2 Ace is backed by a Li-Ion 2,600mAh battery which remains unchanged from the J2 Pro.\r\n','','2017-11-23 15:03:45',1),(1778,881,'Connectivity and Camera\r\nImaging is taken care by the 8-megapxiel rear camera which is aided with an LED flash to take care of low-light conditions. On the front, the smartphone sports a 5-megapxiel front-facing shooter which also has an LED flash to support better selfies. \r\nConnectivity options on the J2 Ace include 4G, dual SIM support, Wi-Fi 802.11 b/g/n, GPS, and a microUSB 2.0 port.\r\n','','2017-11-23 15:03:45',1),(2064,950,'Samsung Guru E1200 is a single SIM feature phone supported with 3.86 cm (1.5) screen that lends resolution of 128 x 128 pixels. It is compact and easy to use. You can save up to 1000 phone numbers on this phone. It has space for storing 500 messages. This feature phone is equipped with a torch light that comes handy during power outage. It can be connected to a computer via USB cable. You can enjoy up to 8 hours 50 minutes of talk-time once this device is fully charged. ','','2017-11-27 19:33:40',1),(2065,950,'Samsung Guru E1200 (Indigo Blue) is designed brilliantly with 3.8 cm (1.5) TFT screen. This phone enhances your viewing experience with its vibrant display portraying 65K colours with a resolution of 128 x 128 pixels.','','2017-11-27 19:33:40',1),(2066,950,'This Samsung feature phone comes with a variety of ringtones. You can choose from the list of tone to put for your incoming calls, messages and alerts.','','2017-11-27 19:33:40',1),(2076,959,'Meet the Redmi Note 4 - the smartphone that will change the way you use your mobile. With a 4100 mAh rechargeable battery and an octa-core Snapdragon 625 processor, this phone ensures a lag-free and glitch-free smartphone experience. ','','2017-11-27 19:39:37',1),(2077,959,'The large display on the Xiaomi Redmi Note 4 is perfect for watching movies, playing games and much more. The addition of a Full HD screen ensures crisp visuals as well.','','2017-11-27 19:39:37',1),(2078,959,'The advanced focusing technology used by the Xiaomi Redmi Note 4