ou get is right up there with most flagship-grade phones. Plus, the storage is more than enough.','','2017-11-27 19:42:50',1),(2088,953,'With a Snapdragon 425 quad-core processor, a 3120 mAh battery and 3 GB of RAM, the Redmi 4A is fast and powerful. It boasts a lightweight and elegant body. But don’t let the pretty face fool you. Underneath its 12.7 cm (5) HD display, the MIUI 8 OS works quietly to offer you a seamless user experience. Adding further to its appeal are its 13 MP rear camera and 5 MP front camera.','','2017-11-27 19:43:59',1),(2089,953,'Weighing only 131.5 g, this smartphone is quite lightweight. Its polycarbonate body boasts a smooth matte-finish, adding to its appeal.','','2017-11-27 19:43:59',1),(2090,953,'Featuring a long-lasting battery and system-level MIUI optimisation, the charge of this phone can last for up to an average of 7 days on standby mode.','','2017-11-27 19:43:59',1),(2091,951,'The new Redmi 4A is better, faster, and is possibly your best companion for both work and leisure. It packs a Snapdragon 425 64-bit, quad-core processor and a massive 3120mAh (typ)/3030mAh (min) battery that guarantees you smoother experience throughout the day. Yet it remains light - just 131.5g - and boasts a smooth matte finish that feels great in your hands.','','2017-11-27 19:45:02',1),(2092,951,'Beneath the 12.7cm (5) HD display runs MIUI 8, the latest operating system that is the most gorgeous and user-friendly operating system we\'ve introduced so far. Despite its large capacity battery, Redmi 4A stays amazingly slim and light at a mere 131.5g. It is housed in a seamless, polycarbonate body that boasts a super smooth matte finish and is to date, the lightest in the Redmi series. Redmi 4A is powered by the large-capacity 3120mAh (typ)/3030mAh (min) battery, and coupled with system-level MIUI optimisations, it guarantees up to an average 7-day standby time. So now you can enjoy movie marathons, launch apps, and play games without worrying about running