.','','2017-12-20 14:48:42',1),(2655,1111,'HP\'s latest offering, the HP Laserjet Pro M1136 is a simple and compact multifunctional printer that offers more features than most other printers in this price range. Apart from high quality printing, you can use it for your copy and scan jobs too. This incredibly lightweight HP LaserJet M1136 Pro Multifunction Monochrome Printer has a narrow footprint that takes up very little space on your desktop. It has an all black matte exterior that looks classy and sophisticated. The top of the printer houses a 150-sheet input tray and a flatbed scanner.','','2017-12-20 14:48:42',1),(2656,1112,'The HP Laserjet 1020 is a single function laser printer that makes printing jobs easy and affordable. This monochrome printer gives professional quality crisp and sharp text images. The design of this HP Printer 1020 is extremely stylish and compact with contoured sloping top, which gives it an elegant look. This sleek HP Laserjet printer 1020 Plus saves a lot of space on your home or office desktop. Paper handling becomes easy and hassle free with its 150-sheet input tray. With a 100-sheet output tray, it delivers an impressive number of prints at a time.','','2017-12-20 14:48:42',1),(2657,1113,'Overview: Save space and money and print wirelessly with the world’s smallest all-in-one printer. Get low-cost color and all the power you need in amazing, compact style. Print, scan, and copy from virtually any mobile device. Wireless performance, low-cost printing, and a dash of color for the ultimate experience. HP Office Inkjet All-in-One Printers deliver professional colour and black-and-white documents at a low cost per page, plus a full range of copy and scan tools with advanced paper-handling options. The tiny all-in-one that packs a punch: Save space and get all the power you need with the world’s smallest all-in-one printer. HP Scroll Scan helps you easily handle most scan jobs, from a variety of papers. Any room, any spot—this ultracompact all-in-one is designed to fit where you need it. Show your style with a sleek design and a variety of head-turning hues.','','2017-12-20 14:48:42',1),(2658,1114,'Epson’s original L565 InkTank printer is perfect for home or office use, delivering high-quality prints at the lowest cost ever. Additionally, with the capability to scan and copy along with features like ADF, Fax, Network and Wifi direct, this all-in-one is surely the most economical solution for all your printing related needs.','','2017-12-20 14:48:42',1),(2659,1114,'A lot of effort goes into your work, be it projects or reports. Which is why the L565 is equipped with Epson’s exclusive Micro Piezo technology that can release extremely fine drops of ink - up to 3 pico-litres - while printing at resolutions of up to 5760 dpi. So, every single print, is a great print.','','2017-12-20 14:48:42',1),(2660,1114,'The Epson L565 accepts premium glossy photo paper and plain paper in an array of different sizes. Print photo-birthday cards, envelopes, A4 posters, half-page party invites or even presentation handouts.','','2017-12-20 14:48:42',1),(2661,1115,'Epson’s original L385 InkTank printer is perfect for home or office use, delivering high-quality prints at the lowest cost ever. Additionally, with the capability to scan and copy, this all-in-one is surely the most economical solution for all your printing related needs.','','2017-12-20 14:48:42',1),(2662,1115,'The Epson L385 offers you ultra-low printing costs. Be it drafts or final copies, itineraries, movie tickets, or even reports and projects - at just 7 paise for a black print, and 18 paise for colour - the L385 ensures printing is never an expensive affair.','','2017-12-20 14:48:42',1),(2663,1115,'No more frequent cartridge changes or refilling. Get a high print yield of 4,500 pages per 70 ml black ink bottle and 7,500 pages for colour. Also, with the convenience of easy-to-use genuine Epson Ink Bottles, you’ll be able to refill your printer with absolutely no effort.','','2017-12-20 14:48:42',1),(2664,1116,'Epson’s L380 ink tank printer brings more to the table with 2 additional black ink bottles, allowing you to print at even higher volumes with lower cost. A higher warranty coverage, of up to 1 year or 30,000 prints, allows you a peace of mind when accomplishing high volume jobs. Complete tasks quicker with print speeds of up to 10ipm for black and 5.0ipm for color.','','2017-12-20 14:48:42',1),(2665,1116,'Thanks to its precise 600 x 1200 dpi sensor, scans are sharp and clear, while draft mode copies are completed in just 5 seconds for black and 10 seconds for color.','','2017-12-20 14:48:42',1),(2666,1116,'One Touch Scan and Copy functions in the all-in-one L380 gives you the added convenience of scan and copy functions.','','2017-12-20 14:48:42',1),(2667,1117,'Get instant laser-quality prints with hassle-free operations using the Laser Shot LBP 2900B from Canon. Print crystal clear monochrome documents, presentations and lots more in superb laser quality. This Canon LBP 2900B printer delivers high-speed output at the rate of 12 pages per minute on A4 size paper. You can also plug in other portable devices to this printer and print the stored data using Hi-speed USB 2.0. Connect this Canon LBP 2900B printer supports all the latest operating systems including Windows 8/ME/2000/XP, Linux (CUPS).','','2017-12-20 14:48:42',1),(2668,1117,'This Canon laser printer has advanced features like CAPT 2.1 (Canon Advanced Printing Technology) that allows the printer to process data faster and deliver crisper prints. With an enhanced resolution of 600 x 600 dpi and the AIR technology, the prints are smoothed up to 2400 x 600 dpi. This Canon LBP 2900B laser printer features Canon\'s exclusive On-Demand Fixing technology for printing urgent documents. The first print is out in approximately 9 seconds with a quick warm up time of less than 10 seconds after power up.','','2017-12-20 14:48:42',1),(2669,1118,'ghgf','','2017-12-2